Zweden
Actie / Thriller
90 minuten

goed

met Mikael Persbrandt, Steven Waddington en John Light

De dochter van de beste vriend van Hamilton wordt ontvoerd nadat haar moeder enkele verklaringen in de media heeft afgelegd over 
een radicale moslimorganisatie. De ontvoerders eisen een grote hoeveelheid losgeld en politieke concessies. Als vriend van de 
familie raakt Hamilton betrokken bij de zaak en het spoor leidt al snel naar een rijke sjeik in de woestijn. Tijdens een 
reddingspoging komt naar voren dat de sjeik banden heeft met Al Qaeda en Hamiltons leven komt plots op het spel te staan.
